import './ButtonAutchLogg.css';
import React from 'react';
import { NavLink, useNavigate } from 'react-router-dom';

function ButtonAutchLogg() {
  return (
    <div className='navigation-button'>
      <button className='navigation-button__register effect' type="button">Регистрация</button>
      <button className='navigation-button__entrance effect' type="button">Войти</button>
    </div>
  )
}

export default ButtonAutchLogg;
